import React from 'react';
import { createRoot } from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

const rootElem = document.getElementById('root');
const reactRoot = createRoot(rootElem);
reactRoot.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
